import React, { useState } from 'react';
import "css/Auction.css";

const Auction = () => {
    const [style, setStyle] = useState({
        backgroundColor : "#bfb4b0",
        border : "1px solid  #bfb4b0"
    })
    const onClick = () => {

    }
    const Filter = (
        <div className="filter">
            <div className="filter-item auction-filter">
                <span className="filter-span">Auction Type</span>
                <ul>
                    <li>for sale</li>
                    <li>siring</li>
                </ul>
            </div>
            <div className="filter-item species-filter">
                <span className="filter-span">Species</span>
                <ul>
                    <li>Doll</li>
                    <li>Car</li>
                    <li>Robot</li>
                </ul>
            </div>
            <div className="filter-item price-filter">
                <span className="filter-span">Price</span>
                <ul>
                    <li>for sale</li>
                    <li>siring</li>
                </ul>
            </div>
        </div>
    )
    return (
        <div className="auction-container">
            <div className="auction-content">
            {Filter}
            </div>
        </div>
    )
}

export default Auction;
